import { StyleSheet } from "react-native";

const StyleEditCenter = StyleSheet.create({
    
    conteiner:{
        display:"flex",
        alignItems:'center',
        width:'100%'
    },
    
    avatar:{
        height:100,
        width:100,
        borderRadius:100000000,
        marginTop:'3%'
    },

    editPhotoButt:{
        marginTop:'10%',
        backgroundColor:'#DAB671'
    }

});

export default StyleEditCenter;
